import React from "react";

function Header() {
    return (
    <div>
        <div className="logo"> 
            <img src="src\images\haven-logo.jpg" alt="Haven Logo"></img>
        </div>
        <header>
            <h1> HAVEN </h1>
        </header> 
    </div>
    );
  }
  
  export default Header;
